Verenigde Staten
Komedie
90 minuten

geregisseerd door T. Sean Shannon
met Cuba Gooding Jr., Spencer Breslin en Ally Sheedy

Harold (Spencer Breslin) is een tiener die zich op zijn nieuwe school probeert in te burgeren. Hij heeft echter een groot probleem, want hij word ondanks zijn erg jonge leeftijd al kaal. Dit maakt het voor hem niet makkelijk, maar gelukkig krijgt hij hulp van zijn leraar Cromer (Cuba Gooding Jr.) om zijn onzekerheid te overwinnen


